'use strict';
let GetRawOffersMessage = require('./GetRawOffersMessage.js');
class GetRawOffersMessageBuilder extends GetRawOffersMessage {
    addRawOffer(rawOffer) {
        this.rawOffersList.add(rawOffer);
    }
    addRawOffers(rawOffers) {
        let i;
        if (rawOffers != null) {
            for (i = 0; i <= rawOffers.length() - 1; i += 1) {
                this.rawOffersList.add(rawOffers.get(i));
            }
        }
    }
    build() {
        return this;
    }
}
module.exports = GetRawOffersMessageBuilder
